const e = createEngine(gameCanvas, 296, 248);

/* BEGIN TEXT */
e.addText("<- what's up with", 226, 129)
e.addText("blockhead?", 238, 144, { size: 20 });

e.addText("why's he just", 238, 189);
e.addText("fall through?", 239, 203, { size: 14 });
/* END TEXT */


/* BEGIN KNIGHT */
e.add({
  sprite: knight,
  solid: true,
  scale: 3,
  x: 88,
  update: (me, them) => {
    /* GRAVITY */
    me.vy += 200;
  }
})
/* END KNIGHT */

/* uwu what's this? */
e.add({
  sprite: tile,
  scale: 2,
  x: 81, 
  y: 113
})

/* BEGIN SOLID TILE */
e.add({
  solid: true,
  sprite: tile,
  scale: 2,
  x: 47, 
  y: 202
})
/* END SOLID TILE */

e.start();
